script: |
  super -f text -I q10503.spq | sort > q10503.out

inputs:
  - name: q10503.spq
    data: |
      SELECT + ( - col1 ) FROM tab1 (FORMAT parquet) WHERE col1 / - col0 + - 53 + + 71 + col1 + col1 NOT BETWEEN - + col2 AND + 65;
  - name: tab1

outputs:
  - name: q10503.out
    data: |
      -47
